create table facturas_compra (
	num_factura VARCHAR(20) NOT NULL,
	id_obra VARCHAR(8) NOT NULL,
	cif_proveedor VARCHAR(9),
	concepto VARCHAR(50),
	base_imponible DECIMAL(7,2) NOT NULL,
	iva DECIMAL(7,2) NOT NULL,
	año INT NOT NULL,
	fecha DATE NOT NULL,
	fecha_cobro DATE,
	PRIMARY KEY (num_factura, cif_proveedor),
	FOREIGN KEY (cif_proveedor) REFERENCES proveedores(cif),
	FOREIGN KEY (id_obra) REFERENCES obras(id)
);
